101	109	Blog	1	{"id":1,"status":"draft","sort":null,"user_created":"83ba0b9b-3591-45b4-8c16-502687726652","date_created":"2023-07-31T11:44:48.160Z","user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-07-31T11:49:28.095Z","title":"An Excerpt about jellyfishes","content":"<p><strong>Jellyfish</strong>&nbsp;and&nbsp;<strong>sea jellies</strong>&nbsp;are the informal common names given to the&nbsp;<a href=\\"https://en.wikipedia.org/wiki/Jellyfish#Life_cycle\\">medusa</a>-phase of certain gelatinous members of the&nbsp;<a title=\\"Subphylum\\" href=\\"https://en.wikipedia.org/wiki/Subphylum\\">subphylum</a>&nbsp;<a title=\\"Medusozoa\\" href=\\"https://en.wikipedia.org/wiki/Medusozoa\\">Medusozoa</a>, a major part of the&nbsp;<a title=\\"Phylum\\" href=\\"https://en.wikipedia.org/wiki/Phylum\\">phylum</a>&nbsp;<a title=\\"Cnidaria\\" href=\\"https://en.wikipedia.org/wiki/Cnidaria\\">Cnidaria</a>. Jellyfish are mainly free-swimming marine&nbsp;<a title=\\"Animal\\" href=\\"https://en.wikipedia.org/wiki/Animal\\">animals</a>&nbsp;with umbrella-shaped bells and trailing&nbsp;<a title=\\"Tentacle\\" href=\\"https://en.wikipedia.org/wiki/Tentacle\\">tentacles</a>, although a few are anchored to the seabed by stalks rather than being mobile. The bell can pulsate to provide propulsion for highly efficient&nbsp;<a title=\\"Animal locomotion\\" href=\\"https://en.wikipedia.org/wiki/Animal_locomotion\\">locomotion</a>. The tentacles are armed with&nbsp;<a title=\\"Cnidocyte\\" href=\\"https://en.wikipedia.org/wiki/Cnidocyte\\">stinging cells</a>&nbsp;and may be used to capture prey and defend against predators. Jellyfish have a complex&nbsp;<a title=\\"Biological life cycle\\" href=\\"https://en.wikipedia.org/wiki/Biological_life_cycle\\">life cycle</a>; the medusa is normally the sexual phase, which produces&nbsp;<a title=\\"Planula\\" href=\\"https://en.wikipedia.org/wiki/Planula\\">planula</a>&nbsp;larvae that disperse widely and enter a sedentary&nbsp;<a href=\\"https://en.wikipedia.org/wiki/Jellyfish#Life_cycle\\">polyp</a>&nbsp;phase before reaching sexual maturity.</p>\\n<p>Jellyfish are found all over the world, from surface waters to the deep sea.&nbsp;<a title=\\"Scyphozoa\\" href=\\"https://en.wikipedia.org/wiki/Scyphozoa\\">Scyphozoans</a>&nbsp;(the \\"true jellyfish\\") are exclusively&nbsp;<a title=\\"Marine habitats\\" href=\\"https://en.wikipedia.org/wiki/Marine_habitats\\">marine</a>, but some&nbsp;<a title=\\"Hydrozoa\\" href=\\"https://en.wikipedia.org/wiki/Hydrozoa\\">hydrozoans</a>&nbsp;with a similar appearance live in&nbsp;<a class=\\"mw-redirect\\" title=\\"Freshwater\\" href=\\"https://en.wikipedia.org/wiki/Freshwater\\">freshwater</a>. Large, often colorful, jellyfish are common in coastal zones worldwide. The medusae of most species are fast-growing, and mature within a few months then die soon after breeding, but the polyp stage, attached to the seabed, may be much more long-lived. Jellyfish have been in existence for at least 500 million years,<sup id=\\"cite_ref-1\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-1\\">[1]</a></sup>&nbsp;and possibly 700 million years or more, making them the oldest multi-organ animal group.<sup id=\\"cite_ref-angier2dec_2-0\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-angier2dec-2\\">[2]</a></sup></p>\\n<p>Jellyfish are eaten by humans in certain cultures. They are considered a delicacy in some Asian countries, where species in the&nbsp;<a title=\\"Rhizostomae\\" href=\\"https://en.wikipedia.org/wiki/Rhizostomae\\">Rhizostomae</a>&nbsp;<a title=\\"Order (biology)\\" href=\\"https://en.wikipedia.org/wiki/Order_(biology)\\">order</a>&nbsp;are pressed and salted to remove excess water. Australian researchers have described them as a \\"perfect food\\": sustainable and protein-rich but relatively low in&nbsp;<a title=\\"Food energy\\" href=\\"https://en.wikipedia.org/wiki/Food_energy\\">food energy</a>.<sup id=\\"cite_ref-asfood_3-0\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-asfood-3\\">[3]</a></sup></p>\\n<p>They are also used in research, where the&nbsp;<a title=\\"Green fluorescent protein\\" href=\\"https://en.wikipedia.org/wiki/Green_fluorescent_protein\\">green fluorescent protein</a>&nbsp;used by some species to cause&nbsp;<a title=\\"Bioluminescence\\" href=\\"https://en.wikipedia.org/wiki/Bioluminescence\\">bioluminescence</a>&nbsp;has been adapted as a fluorescent&nbsp;<a title=\\"Genetic marker\\" href=\\"https://en.wikipedia.org/wiki/Genetic_marker\\">marker</a>&nbsp;for genes&nbsp;<a title=\\"Insertion (genetics)\\" href=\\"https://en.wikipedia.org/wiki/Insertion_(genetics)\\">inserted</a>&nbsp;into other cells or organisms.</p>\\n<p>The stinging cells used by jellyfish to subdue their prey can injure humans. Thousands of swimmers worldwide are stung every year, with effects ranging from mild discomfort to serious injury or even death. When conditions are favourable, jellyfish can form vast swarms, which can be responsible for damage to fishing gear by filling fishing nets, and sometimes clog the cooling systems of power and&nbsp;<a class=\\"mw-redirect\\" title=\\"Desalination plants\\" href=\\"https://en.wikipedia.org/wiki/Desalination_plants\\">desalination plants</a> which draw their water from the sea.</p>","date":"2023-07-31T11:42:00.000Z","categories":1,"translations":[2]}	{"user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-07-31T11:49:28.095Z"}	\N
100	108	Blog_translations	2	{"id":2,"Blog_id":1,"languages_id":"nl-NL","title":"Een stukje over kwallen","content":"<p style=\\"text-align: left;\\"><strong>Kwallen</strong>&nbsp;of&nbsp;<strong>zeekwallen</strong>&nbsp;is een verzamelnaam voor een groep in&nbsp;<a title=\\"Zee\\" href=\\"https://nl.wikipedia.org/wiki/Zee\\">zee</a>&nbsp;levende, vrijzwemmende&nbsp;<a title=\\"Neteldieren\\" href=\\"https://nl.wikipedia.org/wiki/Neteldieren\\">neteldieren</a>&nbsp;(Cnidaria). Kwallen zijn eenvoudig gebouwde zeedieren met een gelatineus, parapluvormig lichaam en neerhangende&nbsp;<a title=\\"Tentakel\\" href=\\"https://nl.wikipedia.org/wiki/Tentakel\\">tentakels</a>. Het lichaam kan zodanig gepulseerd worden dat een effici&euml;nte&nbsp;<a class=\\"mw-redirect\\" title=\\"Voortbeweging\\" href=\\"https://nl.wikipedia.org/wiki/Voortbeweging\\">voortbeweging</a>&nbsp;ontstaat. De tentakels zijn bewapend met&nbsp;<a class=\\"mw-redirect\\" title=\\"Netelcel\\" href=\\"https://nl.wikipedia.org/wiki/Netelcel\\">netelcellen</a>&nbsp;en worden gebruikt om prooien te vangen en roofdieren af te schrikken.</p>\\n<p style=\\"text-align: left;\\">Kwallen komen wereldwijd voor, van oppervlaktewateren tot in de diepzee.&nbsp;<a title=\\"Schijfkwallen\\" href=\\"https://nl.wikipedia.org/wiki/Schijfkwallen\\">Schijfkwallen</a>&nbsp;(de 'echte kwallen') leven uitsluitend in de zee, maar er zijn ook enkele&nbsp;<a title=\\"Hydro&iuml;dpoliepen\\" href=\\"https://nl.wikipedia.org/wiki/Hydro%C3%AFdpoliepen\\">hydro&iuml;dpoliepen</a>&nbsp;met een vergelijkbaar uiterlijk die in zoet water leven. Kwallen hebben een complexe&nbsp;<a title=\\"Levenscyclus\\" href=\\"https://nl.wikipedia.org/wiki/Levenscyclus\\">levenscyclus</a>; de&nbsp;<a title=\\"Meduse\\" href=\\"https://nl.wikipedia.org/wiki/Meduse\\">meduse</a>&nbsp;kan rondzwemmen en brengt na geslachtelijke voortplanting kleine larfjes voort, de zogeheten&nbsp;<a title=\\"Planula\\" href=\\"https://nl.wikipedia.org/wiki/Planula\\">planulae</a>. Uit deze larven groeit een vastzittende&nbsp;<a title=\\"Poliep (neteldier)\\" href=\\"https://nl.wikipedia.org/wiki/Poliep_(neteldier)\\">poliep</a>&nbsp;die kleine kwalletjes afsnoert.</p>\\n<p style=\\"text-align: left;\\">Kwallen worden in een aantal Aziatische landen beschouwd als een&nbsp;<a title=\\"Delicatesse\\" href=\\"https://nl.wikipedia.org/wiki/Delicatesse\\">delicatesse</a>. Hierbij worden ze eerst gedroogd en geperst en vervolgens in een gerecht verwerkt. Kwallen spelen ook een rol in wetenschappelijk onderzoek. Het&nbsp;<a title=\\"Groen fluorescent prote&iuml;ne\\" href=\\"https://nl.wikipedia.org/wiki/Groen_fluorescent_prote%C3%AFne\\">groen fluorescent prote&iuml;ne</a>&nbsp;werd oorspronkelijk uit een bioluminescente kwal ge&iuml;soleerd, en is inmiddels een zeer belangrijke&nbsp;<a title=\\"Fluorofoor\\" href=\\"https://nl.wikipedia.org/wiki/Fluorofoor\\">marker</a>&nbsp;in de biotechnologie. Ieder jaar worden duizenden mensen tijdens het zwemmen door kwallen gestoken.<sup id=\\"cite_ref-smith_2-0\\" class=\\"reference\\"><a href=\\"https://nl.wikipedia.org/wiki/Kwallen#cite_note-smith-2\\">[2]</a></sup>&nbsp;De effecten vari&euml;ren van licht ongemak tot ernstig letsel of zelfs de dood; vooral kleine&nbsp;<a title=\\"Kubuskwallen\\" href=\\"https://nl.wikipedia.org/wiki/Kubuskwallen\\">kubuskwallen</a> zijn verantwoordelijk voor veel van de beschreven sterfgevallen.</p>"}	{"Blog_id":"1","languages_id":"nl-NL","content":"<p style=\\"text-align: left;\\"><strong>Kwallen</strong>&nbsp;of&nbsp;<strong>zeekwallen</strong>&nbsp;is een verzamelnaam voor een groep in&nbsp;<a title=\\"Zee\\" href=\\"https://nl.wikipedia.org/wiki/Zee\\">zee</a>&nbsp;levende, vrijzwemmende&nbsp;<a title=\\"Neteldieren\\" href=\\"https://nl.wikipedia.org/wiki/Neteldieren\\">neteldieren</a>&nbsp;(Cnidaria). Kwallen zijn eenvoudig gebouwde zeedieren met een gelatineus, parapluvormig lichaam en neerhangende&nbsp;<a title=\\"Tentakel\\" href=\\"https://nl.wikipedia.org/wiki/Tentakel\\">tentakels</a>. Het lichaam kan zodanig gepulseerd worden dat een effici&euml;nte&nbsp;<a class=\\"mw-redirect\\" title=\\"Voortbeweging\\" href=\\"https://nl.wikipedia.org/wiki/Voortbeweging\\">voortbeweging</a>&nbsp;ontstaat. De tentakels zijn bewapend met&nbsp;<a class=\\"mw-redirect\\" title=\\"Netelcel\\" href=\\"https://nl.wikipedia.org/wiki/Netelcel\\">netelcellen</a>&nbsp;en worden gebruikt om prooien te vangen en roofdieren af te schrikken.</p>\\n<p style=\\"text-align: left;\\">Kwallen komen wereldwijd voor, van oppervlaktewateren tot in de diepzee.&nbsp;<a title=\\"Schijfkwallen\\" href=\\"https://nl.wikipedia.org/wiki/Schijfkwallen\\">Schijfkwallen</a>&nbsp;(de 'echte kwallen') leven uitsluitend in de zee, maar er zijn ook enkele&nbsp;<a title=\\"Hydro&iuml;dpoliepen\\" href=\\"https://nl.wikipedia.org/wiki/Hydro%C3%AFdpoliepen\\">hydro&iuml;dpoliepen</a>&nbsp;met een vergelijkbaar uiterlijk die in zoet water leven. Kwallen hebben een complexe&nbsp;<a title=\\"Levenscyclus\\" href=\\"https://nl.wikipedia.org/wiki/Levenscyclus\\">levenscyclus</a>; de&nbsp;<a title=\\"Meduse\\" href=\\"https://nl.wikipedia.org/wiki/Meduse\\">meduse</a>&nbsp;kan rondzwemmen en brengt na geslachtelijke voortplanting kleine larfjes voort, de zogeheten&nbsp;<a title=\\"Planula\\" href=\\"https://nl.wikipedia.org/wiki/Planula\\">planulae</a>. Uit deze larven groeit een vastzittende&nbsp;<a title=\\"Poliep (neteldier)\\" href=\\"https://nl.wikipedia.org/wiki/Poliep_(neteldier)\\">poliep</a>&nbsp;die kleine kwalletjes afsnoert.</p>\\n<p style=\\"text-align: left;\\">Kwallen worden in een aantal Aziatische landen beschouwd als een&nbsp;<a title=\\"Delicatesse\\" href=\\"https://nl.wikipedia.org/wiki/Delicatesse\\">delicatesse</a>. Hierbij worden ze eerst gedroogd en geperst en vervolgens in een gerecht verwerkt. Kwallen spelen ook een rol in wetenschappelijk onderzoek. Het&nbsp;<a title=\\"Groen fluorescent prote&iuml;ne\\" href=\\"https://nl.wikipedia.org/wiki/Groen_fluorescent_prote%C3%AFne\\">groen fluorescent prote&iuml;ne</a>&nbsp;werd oorspronkelijk uit een bioluminescente kwal ge&iuml;soleerd, en is inmiddels een zeer belangrijke&nbsp;<a title=\\"Fluorofoor\\" href=\\"https://nl.wikipedia.org/wiki/Fluorofoor\\">marker</a>&nbsp;in de biotechnologie. Ieder jaar worden duizenden mensen tijdens het zwemmen door kwallen gestoken.<sup id=\\"cite_ref-smith_2-0\\" class=\\"reference\\"><a href=\\"https://nl.wikipedia.org/wiki/Kwallen#cite_note-smith-2\\">[2]</a></sup>&nbsp;De effecten vari&euml;ren van licht ongemak tot ernstig letsel of zelfs de dood; vooral kleine&nbsp;<a title=\\"Kubuskwallen\\" href=\\"https://nl.wikipedia.org/wiki/Kubuskwallen\\">kubuskwallen</a> zijn verantwoordelijk voor veel van de beschreven sterfgevallen.</p>"}	101
