102	110	Blog_translations	4	{"id":4,"Blog_id":2,"languages_id":"nl-NL","title":"Een stukje over kwallen","content":"<p style=\\"text-align: left;\\"><strong>Kwallen</strong>&nbsp;of&nbsp;<strong>zeekwallen</strong>&nbsp;is een verzamelnaam voor een groep in&nbsp;<a title=\\"Zee\\" href=\\"https://nl.wikipedia.org/wiki/Zee\\">zee</a>&nbsp;levende, vrijzwemmende&nbsp;<a title=\\"Neteldieren\\" href=\\"https://nl.wikipedia.org/wiki/Neteldieren\\">neteldieren</a>&nbsp;(Cnidaria). Kwallen zijn eenvoudig gebouwde zeedieren met een gelatineus, parapluvormig lichaam en neerhangende&nbsp;<a title=\\"Tentakel\\" href=\\"https://nl.wikipedia.org/wiki/Tentakel\\">tentakels</a>. Het lichaam kan zodanig gepulseerd worden dat een effici&euml;nte&nbsp;<a class=\\"mw-redirect\\" title=\\"Voortbeweging\\" href=\\"https://nl.wikipedia.org/wiki/Voortbeweging\\">voortbeweging</a>&nbsp;ontstaat. De tentakels zijn bewapend met&nbsp;<a class=\\"mw-redirect\\" title=\\"Netelcel\\" href=\\"https://nl.wikipedia.org/wiki/Netelcel\\">netelcellen</a>&nbsp;en worden gebruikt om prooien te vangen en roofdieren af te schrikken.</p>\\n<p style=\\"text-align: left;\\">Kwallen komen wereldwijd voor, van oppervlaktewateren tot in de diepzee.&nbsp;<a title=\\"Schijfkwallen\\" href=\\"https://nl.wikipedia.org/wiki/Schijfkwallen\\">Schijfkwallen</a>&nbsp;(de 'echte kwallen') leven uitsluitend in de zee, maar er zijn ook enkele&nbsp;<a title=\\"Hydro&iuml;dpoliepen\\" href=\\"https://nl.wikipedia.org/wiki/Hydro%C3%AFdpoliepen\\">hydro&iuml;dpoliepen</a>&nbsp;met een vergelijkbaar uiterlijk die in zoet water leven. Kwallen hebben een complexe&nbsp;<a title=\\"Levenscyclus\\" href=\\"https://nl.wikipedia.org/wiki/Levenscyclus\\">levenscyclus</a>; de&nbsp;<a title=\\"Meduse\\" href=\\"https://nl.wikipedia.org/wiki/Meduse\\">meduse</a>&nbsp;kan rondzwemmen en brengt na geslachtelijke voortplanting kleine larfjes voort, de zogeheten&nbsp;<a title=\\"Planula\\" href=\\"https://nl.wikipedia.org/wiki/Planula\\">planulae</a>. Uit deze larven groeit een vastzittende&nbsp;<a title=\\"Poliep (neteldier)\\" href=\\"https://nl.wikipedia.org/wiki/Poliep_(neteldier)\\">poliep</a>&nbsp;die kleine kwalletjes afsnoert.</p>\\n<p style=\\"text-align: left;\\">Kwallen worden in een aantal Aziatische landen beschouwd als een&nbsp;<a title=\\"Delicatesse\\" href=\\"https://nl.wikipedia.org/wiki/Delicatesse\\">delicatesse</a>. Hierbij worden ze eerst gedroogd en geperst en vervolgens in een gerecht verwerkt. Kwallen spelen ook een rol in wetenschappelijk onderzoek. Het&nbsp;<a title=\\"Groen fluorescent prote&iuml;ne\\" href=\\"https://nl.wikipedia.org/wiki/Groen_fluorescent_prote%C3%AFne\\">groen fluorescent prote&iuml;ne</a>&nbsp;werd oorspronkelijk uit een bioluminescente kwal ge&iuml;soleerd, en is inmiddels een zeer belangrijke&nbsp;<a title=\\"Fluorofoor\\" href=\\"https://nl.wikipedia.org/wiki/Fluorofoor\\">marker</a>&nbsp;in de biotechnologie. Ieder jaar worden duizenden mensen tijdens het zwemmen door kwallen gestoken.<sup id=\\"cite_ref-smith_2-0\\" class=\\"reference\\"><a href=\\"https://nl.wikipedia.org/wiki/Kwallen#cite_note-smith-2\\">[2]</a></sup>&nbsp;De effecten vari&euml;ren van licht ongemak tot ernstig letsel of zelfs de dood; vooral kleine&nbsp;<a title=\\"Kubuskwallen\\" href=\\"https://nl.wikipedia.org/wiki/Kubuskwallen\\">kubuskwallen</a> zijn verantwoordelijk voor veel van de beschreven sterfgevallen.</p>"}	{"Blog_id":"2","languages_id":"nl-NL","content":"<p style=\\"text-align: left;\\"><strong>Kwallen</strong>&nbsp;of&nbsp;<strong>zeekwallen</strong>&nbsp;is een verzamelnaam voor een groep in&nbsp;<a title=\\"Zee\\" href=\\"https://nl.wikipedia.org/wiki/Zee\\">zee</a>&nbsp;levende, vrijzwemmende&nbsp;<a title=\\"Neteldieren\\" href=\\"https://nl.wikipedia.org/wiki/Neteldieren\\">neteldieren</a>&nbsp;(Cnidaria). Kwallen zijn eenvoudig gebouwde zeedieren met een gelatineus, parapluvormig lichaam en neerhangende&nbsp;<a title=\\"Tentakel\\" href=\\"https://nl.wikiped