iki/Groen_fluorescent_prote%C3%AFne\\">groen fluorescent prote&iuml;ne</a>&nbsp;werd oorspronkelijk uit een bioluminescente kwal ge&iuml;soleerd, en is inmiddels een zeer belangrijke&nbsp;<a title=\\"Fluorofoor\\" href=\\"https://nl.wikipedia.org/wiki/Fluorofoor\\">marker</a>&nbsp;in de biotechnologie. Ieder jaar worden duizenden mensen tijdens het zwemmen door kwallen gestoken.<sup id=\\"cite_ref-smith_2-0\\" class=\\"reference\\"><a href=\\"https://nl.wikipedia.org/wiki/Kwallen#cite_note-smith-2\\">[2]</a></sup>&nbsp;De effecten vari&euml;ren van licht ongemak tot ernstig letsel of zelfs de dood; vooral kleine&nbsp;<a title=\\"Kubuskwallen\\" href=\\"https://nl.wikipedia.org/wiki/Kubuskwallen\\">kubuskwallen</a> zijn verantwoordelijk voor veel van de beschreven sterfgevallen.</p>"}	103
