294	353	Blog	1	{"id":1,"status":"published","sort":null,"user_created":"83ba0b9b-3591-45b4-8c16-502687726652","date_created":"2023-07-31T11:44:48.160Z","user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-07-31T12:47:47.725Z","title":"An Excerpt about jellyfishes","content":"<p><strong>Jellyfish</strong>&nbsp;and&nbsp;<strong>sea jellies</strong>&nbsp;are the informal common names given to the&nbsp;<a href=\\"https://en.wikipedia.org/wiki/Jellyfish#Life_cycle\\">medusa</a>-phase of certain gelatinous members of the&nbsp;<a title=\\"Subphylum\\" href=\\"https://en.wikipedia.org/wiki/Subphylum\\">subphylum</a>&nbsp;<a title=\\"Medusozoa\\" href=\\"https://en.wikipedia.org/wiki/Medusozoa\\">Medusozoa</a>, a major part of the&nbsp;<a title=\\"Phylum\\" href=\\"https://en.wikipedia.org/wiki/Phylum\\">phylum</a>&nbsp;<a title=\\"Cnidaria\\" href=\\"https://en.wikipedia.org/wiki/Cnidaria\\">Cnidaria</a>. Jellyfish are mainly free-swimming marine&nbsp;<a title=\\"Animal\\" href=\\"https://en.wikipedia.org/wiki/Animal\\">animals</a>&nbsp;with umbrella-shaped bells and trailing&nbsp;<a title=\\"Tentacle\\" href=\\"https://en.wikipedia.org/wiki/Tentacle\\">tentacles</a>, although a few are anchored to the seabed by stalks rather than being mobile. The bell can pulsate to provide propulsion for highly efficient&nbsp;<a title=\\"Animal locomotion\\" href=\\"https://en.wikipedia.org/wiki/Animal_locomotion\\">locomotion</a>. The tentacles are armed with&nbsp;<a title=\\"Cnidocyte\\" href=\\"https://en.wikipedia.org/wiki/Cnidocyte\\">stinging cells</a>&nbsp;and may be used to capture prey and defend against predators. Jellyfish have a complex&nbsp;<a title=\\"Biological life cycle\\" href=\\"https://en.wikipedia.org/wiki/Biological_life_cycle\\">life cycle</a>; the medusa is normally the sexual phase, which produces&nbsp;<a title=\\"Planula\\" href=\\"https://en.wikipedia.org/wiki/Planula\\">planula</a>&nbsp;larvae that disperse widely and enter a sedentary&nbsp;<a href=\\"https://en.wikipedia.org/wiki/Jellyfish#Life_cycle\\">polyp</a>&nbsp;phase before reaching sexual maturity.</p>\\n<p>Jellyfish are found all over the world, from surface waters to the deep sea.&nbsp;<a title=\\"Scyphozoa\\" href=\\"https://en.wikipedia.org/wiki/Scyphozoa\\">Scyphozoans</a>&nbsp;(the \\"true jellyfish\\") are exclusively&nbsp;<a title=\\"Marine habitats\\" href=\\"https://en.wikipedia.org/wiki/Marine_habitats\\">marine</a>, but some&nbsp;<a title=\\"Hydrozoa\\" href=\\"https://en.wikipedia.org/wiki/Hydrozoa\\">hydrozoans</a>&nbsp;with a similar appearance live in&nbsp;<a class=\\"mw-redirect\\" title=\\"Freshwater\\" href=\\"https://en.wikipedia.org/wiki/Freshwater\\">freshwater</a>. Large, often colorful, jellyfish are common in coastal zones worldwide. The medusae of most species are fast-growing, and mature within a few months then die soon after breeding, but the polyp stage, attached to the seabed, may be much more long-lived. Jellyfish have been in existence for at least 500 million years,<sup id=\\"cite_ref-1\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-1\\">[1]</a></sup>&nbsp;and possibly 700 million years or more, making them the oldest multi-organ animal group.<sup id=\\"cite_ref-angier2dec_2-0\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-angier2dec-2\\">[2]</a></sup></p>\\n<p>Jellyfish are eaten by humans in certain cultures. They are considered a delicacy in some Asian countries, where species in the&nbsp;<a title=\\"Rhizostomae\\" href=\\"https://en.wikipedia.org/wiki/Rhizostomae\\">Rhizostomae</a>&nbsp;<a title=\\"Order (biology)\\" href=\\"https://en.wikipedia.org/wiki/Order_(biology)\\">order</a>&nbsp;are pressed and salted to remove excess water. Australian researchers have described them as a \\"perfect food\\": sustainable and protein-rich but relatively low in&nbsp;<a title=\\"Food energy\\" href=\\"https://en.wikipedia.org/wiki/Food_energy\\">food energy</a>.<sup id=\\"cite_ref-asfood_3-0\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-asfood-3\\">[3]</a></sup></p>\\n<p>They are also used in research, where the&nbsp;<a title=\\"Green fluorescent protein\\" href=\\"https://en.wikipedia.org/wiki/Green_fluorescent_protein\\">green fluorescent protein</a>&nbsp;used by some species to cause&nbsp;<a title=\\"Bioluminescence\\" href=\\"https://en.wikipedia.org/wiki/Bioluminescence\\">bioluminescence</a>&nbsp;has been adapted as a fluorescent&nbsp;<a title=\\"Genetic marker\\" href=\\"https://en.wikipedia.org/wiki/Genetic_marker\\">marker</a>&nbsp;for genes&nbsp;<a title=\\"Insertion (genetics)\\" href=\\"https://en.wikipedia.org/wiki/Insertion_(genetics)\\">inserted</a>&nbsp;into other cells or organisms.</p>\\n<p>The stinging cells used by jellyfish to subdue their prey can injure humans. Thousands of swimmers worldwide are stung every year, with effects ranging from mild discomfort to serious injury or even death. When conditions are favourable, jellyfish can form vast swarms, which can be responsible for damage to fishing gear by filling fishing nets, and sometimes clog the cooling systems of power and&nbsp;<a class=\\"mw-redirect\\" title=\\"Desalination plants\\" href=\\"https://en.wikipedia.org/wiki/Desalination_plants\\">desalination plants</a> which draw their water from the sea.</p>","date":"2023-07-31T11:42:00.000Z","categories":1,"Blog_id":1,"image":null,"Author":"e1aa266f-ec8c-46e0-b42e-6845fa2f2603","translations":[2]}	{"Author":"e1aa266f-ec8c-46e0-b42e-6845fa2f2603","user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-07-31T12:47:47.725Z"}	\N
