nergy\\">food energy</a>.<sup id=\\"cite_ref-asfood_3-0\\" class=\\"reference\\"><a href=\\"https://en.wikipedia.org/wiki/Jellyfish#cite_note-asfood-3\\">[3]</a></sup></p>\\n<p>They are also used in research, where the&nbsp;<a title=\\"Green fluorescent protein\\" href=\\"https://en.wikipedia.org/wiki/Green_fluorescent_protein\\">green fluorescent protein</a>&nbsp;used by some species to cause&nbsp;<a title=\\"Bioluminescence\\" href=\\"https://en.wikipedia.org/wiki/Bioluminescence\\">bioluminescence</a>&nbsp;has been adapted as a fluorescent&nbsp;<a title=\\"Genetic marker\\" href=\\"https://en.wikipedia.org/wiki/Genetic_marker\\">marker</a>&nbsp;for genes&nbsp;<a title=\\"Insertion (genetics)\\" href=\\"https://en.wikipedia.org/wiki/Insertion_(genetics)\\">inserted</a>&nbsp;into other cells or organisms.</p>\\n<p>The stinging cells used by jellyfish to subdue their prey can injure humans. Thousands of swimmers worldwide are stung every year, with effects ranging from mild discomfort to serious injury or even death. When conditions are favourable, jellyfish can form vast swarms, which can be responsible for damage to fishing gear by filling fishing nets, and sometimes clog the cooling systems of power and&nbsp;<a class=\\"mw-redirect\\" title=\\"Desalination plants\\" href=\\"https://en.wikipedia.org/wiki/Desalination_plants\\">desalination plants</a> which draw their water from the sea.</p>","categories":1,"Blog_id":1,"image":null,"Author":"e1aa266f-ec8c-46e0-b42e-6845fa2f2603","date":"2023-08-01T13:08:19","translations":[2]}	{"date":"2023-08-01T13:08:19","user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-08-01T11:08:19.958Z"}	\N
