511	583	Blog	1	{"id":3,"status":"published","sort":null,"user_created":"83ba0b9b-3591-45b4-8c16-502687726652","date_created":"2023-07-31T11:54:14.496Z","user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-08-01T11:11:02.309Z","title":"First blogpost on Directus","content":"<p>Totally have a setup inside directus right now.</p>","categories":3,"Blog_id":1,"image":null,"Author":"83ba0b9b-3591-45b4-8c16-502687726652","date":"2023-08-01T13:11:02","translations":[5,6]}	{"date":"2023-08-01T13:11:02","user_updated":"83ba0b9b-3591-45b4-8c16-502687726652","date_updated":"2023-08-01T11:11:02.309Z"}	\N
